import sys

def main():
    n = int(sys.stdin.readline())
    strings = []
    for i in range(n):
        strings.append(sys.stdin.readline().strip())
    strings.sort(key=len)
    for i in range(n):
        for j in range(i):
            if strings[i].find(strings[j]) == -1:
                print("NO")
                return
