n = int(input())
strings = []
for _ in range(n):
    strings.append(input())

def is_substring(a, b):
    for i in range(len(b)):
        if a == b[i:i+len(a)]:
            return True
    return False

def is_valid(strings):
    for i in range(len(strings)):
        for j in range(i):
            if not is_substring(strings[j], strings[i]):
                return False
    return True

def sort_strings(strings):
    if is_valid(strings):
        print('YES')
        for s in strings:
            print(s)
    else:
        print('NO')

sort_strings(strings)

def is_substring(s1, s2):
    if s1 == s2:
        return True
    if len(s1) > len(s2):
        return False
    for i in range(len(s2) - len(s1) + 1):
        if s2[i:i+len(s1)] == s1:
            return True
    return False

def is_substring_list(s1, l):
    for s in l:
        if is_substring(s1, s):
            return True
    return False

def solve(l):
    l.sort(key=lambda x: len(x))
    for i in range(len(l)):
        if not is_substring_list(l[i], l[:i]):
            return False
    return True

def main():
    n = int(input())
    l = []
    for _ in range(n):
        l.append(input())
    if solve(l):
        print('YES')
        for s in l:
            print(s)
    else:
        print('NO')

if __name__ == '__main__':
    main()

